pragma solidity >= 0.5.0 < 0.7.0;
contract forgerydetection{

struct passportrequest{

	// State variables

	uint aids;
	uint user_id;
	string passportnum;
	string date;
	string status;

}


passportrequest []m;



function acceptedrequest(uint aids,uint user_id, string memory passportnum,string memory date,string memory status) public{
	passportrequest memory m1=passportrequest(aids,user_id,passportnum,date,status);
	m.push(m1);
}


}
